import React from "react";
import Banner from "../components/Banner";
import HouseList from "../components/HouseList";
import PropertyDetails from "../pages/PropertyDetails";

const Home = () => {
  return (
    <div className=" min-h-[1800px]">
      <Banner />
      <HouseList />
      <PropertyDetails />
    </div>
  );
};

export default Home;
